INSERT INTO `contracts` VALUES (0000000001,2021,'01/CEARAPAR/2021','2021-12-27','2022-12-27','2022-01-11','2023-01-11','Serviços de contabilidade e consultoria técnica nas áreas fiscal e previdenciária, aferindo responsabilidade técnica sobre a elaboração de peças contábeis exigidas pela legislação vigente, sem qualquer vínculo empregatício ou responsabilidades decorrentes da legislação trabalhista.<br />\r\n','Controller Auditoria e Assessoria Contábil S/S-EPP','Diretoria da Presidência',45600.00,'upload/contratos/extrato contrato contabilidade.pdf','2022-12-23 09:09:58'),(0000000010,2022,'01/CEARAPAR/2022','2022-03-22','2025-03-22','2022-04-01','2022-04-01','O CONTRATO tem como objeto a prestação, pela CONTRATADA à CONTRATANTE, sem exclusividade, das atividades relacionadas aos serviços de nuvem e transporte de dados por meio do Cinturão Digital do Ceará (CDC), conforme termos, preços e quantitativos presentes na Proposta Comercial (Anexo I) e Termo de Referência/Documento de Especificação Técnica (Anexo II), incluindo, de maneira geral, os seguintes serviços: <br />\r\n(a) Serviço Especializado de Infraestrutura como Serviço (IaaS);<br />\r\n(b) Serviço Especializado de Software como Serviço (SaaS); e,<br />\r\n(c) Cinturão Digital do Ceará (CDC);\"<br />\r\n','Empresa de Tecnologia da informação do Ceará - ETICE','Diretoria da Presidência',464127.82,'upload/contratos/Extrato do Contrato-ETICE.pdf','2022-12-23 09:15:10'),(0000000011,2022,'02/CEARAPAR/2022','2022-03-22','0003-03-22','2022-04-01','2023-04-01','O CONTRATO tem como objeto a prestação, pela CONTRATADA à CONTRATANTE, sem exclusividade, das ativida-des relacionadas aos serviços de empresa especializada em auditoria contábil financeira independente, de acordo com as normas e pronunciamentos do Instituto dos Auditores Independentes do Brasil — IBRACON, e do Conselho Federal de Contabilidade, com a finalidade de validar as demonstrações contábeis e financeiras, sem qualquer vínculo empre-gatício ou responsabilidades decorrentes da legislação trabalhista, em regime de Empreitada por Preço Global, dora-vante denominado simplesmente SERVIÇOS, tudo de acordo com o Termo de Referência que fundamenta a presente contratação e que faz parte do presente CONTRATO.<br />\r\n','AUDIPLAC -Auditoria e Assessoria Contabil S/S','Diretoria da Presidência',28900.00,'upload/contratos/Extrato do Contrato-AUDIPLAC.pdf','2022-12-23 09:26:30'),(0000000012,2022,'02-A/CEARAPAR/2022','2022-04-04','2022-08-04','2022-04-06','2022-08-06','Prestação de serviços, pela CONTRATADA à CONTRATANTE, para ministrar treinamento teórico e  específicos sobre legislação societária e de mercado de capitais, divulgação de informações, controle interno, código de conduta, a Lei nº 12.846, de 1º de agosto de 2013 (Lei Anticorrupção), e demais temas relacionados às atividades da empresa pública ou da sociedade de economia mista para os membros do Conselho de Admi-nistração, os diretores, inclusive presidente e demais colaboradores da CearaPar, conforme art. 17, § 4º da Lei nº 13.303/2016, quantidades e especificações contidas no Termo de Referência e seus anexos.<br />\r\n','Instituto Brasileiro de Governança Corporativa- IBGC','Diretoria da Presidência',24800.00,'upload/contratos/Extrato do Contrato-IBGC.pdf','2022-12-23 09:28:42'),(0000000013,2022,'04/CEARAPAR/2022','2022-05-04','2023-05-04','2022-05-17','2023-05-17','Prestação, pela CONTRATADA à CONTRATANTE, sem exclusividade, das atividades relacionadas aos serviços de empresa especializada em serviços de locação de equipamentos de informática, incluindo distribuição, instalação, suporte, assistência técnica e manutenção preventiva e corretiva in loco, reposição de peças e insumos (exceto papel), para atender os serviços administrativos exercidos pelos servidores da Companhia de Participação e Gestão de Ativos do Ceará.','DR. Software Serviços LTDA','Diretoria da Presidência',47417.28,'upload/contratos/Extrato de Dispensa-Locação.pdf','2022-12-23 09:30:10'),(0000000014,2022,'05/CEARAPAR/2022','2022-05-17','2023-05-17','2022-05-18','2023-05-18','A prestação, pela CONTRATADA à CONTRATANTE, sem exclusividade, das atividades relacionadas aos serviços de empresa especializada em plataforma de Gerenciamento de Conteúdo (CMS) Wordpress (aplicativo de sistema de gerenciamento de conteúdo para web) para instalação, implantação, desenvolvimento, atuali-zação, manutenção (adaptativa, corretiva, evolutiva e preventiva) de sistema dos sites e hotsites, com criação da identidade visual da CearaPar, conforme especificações detalhadas no contrato.','Antonio Alisson Almeida Queiroz Sistemas','DIAFI',23000.00,'upload/contratos/Extrado de Contrato - SITE.pdf','2022-12-23 09:32:14'),(0000000015,2022,'06/CEARAPAR/2022','2022-11-30','2023-02-28','2011-11-30','2022-11-30','Serviços de organização, planejamento e execução do evento denominado “I Encontro Estadual das Estatais do Estado do Ceará” - doravante denominado simplesmente EVENTO, compreendendo-se no escopo da prestação do serviço as atividades relacionadas à elaboração e fornecimento de infraestrutura no que se refere à locação de espaço físico, com mobiliário necessário e adequado, incluindo-se as atividades de limpeza, manutenção, instalações elétricas, hidráulicas, equipamentos de som para a palestra e outros serviços correlatos, bem como o devido fornecimento de alimentação.','SERVIÇO NACIONAL DE APRENDIZAGEM COMERCIAL -SENAC/AR/CE','DIAFI',6425.00,'upload/contratos/EXTRATO DE CONTRATO 06-2022 - MAYU.pdf','2023-01-06 11:12:28'),(0000000016,2023,'0001/2023','2023-01-27','2024-01-27','2023-02-02','2024-02-02','Serviço de assessoria e consultoria contábil, fiscal, tributária, trabalhista, previdenciária e financeira,durante o exercício do ano de 2023, aferindo responsabilidade técnica sobre a elaboração de peças contábeis exigidas pela legislação vigente, sem qualquer vínculo empregatício ou responsabilidades decorrentes da legislação trabalhista.','ARRAIS E COSTA CONSULTORIA CONTABIL S/S LTDA','Diretoria Administrativo-Financeira',28000.00,'upload/contratos/Extrato_contabilidade_19022000059202372.pdf','2023-02-06 12:06:47');
