INSERT INTO `legislation` VALUES (3,'lei','estadual','2016-06-30',13303,'DISPÕE SOBRE O ESTATUTO JURÍDICO DA EMPRESA PÚBLICA, DA SOCIEDADE DE ECONOMIA MISTA E DE SUAS SUBSIDIÁRIAS, NO ÂMBITO DA UNIÃO, DOS ESTADOS, DO DISTRITO FEDERAL E DOS MUNICÍPIOS.','upload/legislation/Lei_13303_ de_30_de_junho_de_2016.pdf','2022-12-15 19:38:27'),(4,'lei','federal','1976-12-15',6404,'DISPÕE SOBRE AS SOCIEDADES POR AÇÕES.','upload/legislation/Lei_6404_de_15_de_dezembro_de_1976.pdf','2022-12-15 19:39:48'),(5,'lei','estadual','2018-12-14',16698,'AUTORIZA A CRIAÇÃO DA COMPANHIA DE PARTICIPAÇÃO E GESTÃO DE ATIVOS DO CEARÁ – CEARAPAR, AUTORIZA A CESSÃO DE DIREITOS CREDITÓRIOS, TRANSFERÊNCIA DE ATIVOS.','upload/legislation/LEI N.º 16.698, DE 14.12.18 (D.O. 17.12.18).pdf','2022-12-15 19:41:30'),(6,'decreto','estadual','2021-09-15',34238,'REGULAMENTA, NO ÂMBITO DO PODER EXECUTIVO ESTADUAL, A LEI N°16.698, DE 14 DEZEMBRO DE 2018, QUE DISPÕE SOBRE A CRIAÇÃO DA COMPANHIA DE PARTICIPAÇÃO E GESTÃO DE ATIVOS DO CEARÁ (CEARAPAR), E ALTERA O DECRETO N°27.439, DE 3 DE MAIO DE 2004.','upload/legislation/DECRETO N°34.238, de 15 de setembro de 2021.pdf','2022-12-15 19:42:06'),(7,'decreto','estadual','2022-05-02',34723,'CRIA E REGULAMENTA, NO ÂMBITO DO PODER EXECUTIVO ESTADUAL, O SISTEMA DE ADMINISTRAÇÃO DE ATIVOS PÚBLICOS DO ESTADO DO CEARÁ COM O OBJETIVO DE FOMENTAR O PLANEJAMENTO, A PROGRAMAÇÃO, A EXECUÇÃO CENTRALIZADA, A ORIENTAÇÃO NORMATIVA, O CONTROLE TÉCNICO, A FISCALIZAÇÃO E ACOMPANHAMENTO DAS ATIVIDADES RELACIONADAS AOS ATIVOS PÚBLICOS.','upload/legislation/DECRETO Nº34.723, de 02 de maio de 2022.pdf','2022-12-15 19:42:40'),(8,'decreto','estadual','2016-12-23',32112,'DISPÕE SOBRE REGRAS DE GOVERNANÇA PARA EMPRESAS PÚBLICAS E SOCIEDADES DE ECONOMIA MISTA ESTADUAIS, NA FORMA DO §3º, DO ART.1º, DA LEI FEDERAL Nº13.303, DE 30 DE JUNHO DE 2016, E DÁ OUTRAS PROVIDÊNCIAS.','upload/legislation/Decreto-32.112-2016-Regras-de-Governança-Estatais-Ceará-do20161227p01.pdf','2022-12-15 19:43:46'),(9,'decreto','estadual','2018-06-25',32722,'ALTERA O DECRETO Nº32.112, DE 23 DE DEZEMBRO DE 2016, E DÁ OUTRAS PROVIDÊNCIAS.','upload/legislation/Decreto-32.722-2018-ALTERA-O-DECRETO-Nº32.112-DE-23-DE-DEZEMBRO-DE-2016-E-DÁ-OUTRAS-PROVIDÊNCIAS.pdf.pdf.pdf','2022-12-15 19:44:13'),(10,'decreto','estadual','2017-05-31',32243,'DISPÕE SOBRE A APLICAÇÃO, NO ÂMBITO ESTADUAL, DA LEI FEDERAL Nº13.303, DE 30 DE JUNHO DE 2016, PARA AS EMPRESAS PÚBLICAS E SOCIEDADES DE ECONOMIA MISTA DO ESTADO DO CEARÁ DE MAIOR RECEITA OPERACIONAL.','upload/legislation/Decreto-Estadual-32.243-de-31-de-maio-de-2017.pdf','2022-12-15 19:44:59'),(11,'lei','estadual','2022-12-16',296,'INSTITUI O NOVO MARCO LEGAL DA GESTÃO DE ATIVOS IMOBILIÁRIOS DO ESTADO DO CEARÁ, PERMITE A INTEGRALIZAÇÃO DE BENS E DIREITOS A FUNDOS DE INVESTIMENTO.','upload/legislation/LEI COMPLEMENTAR Nº296, de 16 de dezembro de 2022.pdf','2023-01-04 16:09:14');
